import React from "react";

const IsGoingOut = () => {
  const [state, setState] = React.useState(true);
  function active() {
    setState((prevState) => {
        !prevState ? 'Yes' : 'No' 
    });
  }

  return (
    <div>
      <button className="btn" onClick={active}>
        Click me!
      </button>
      <h1>{state}</h1>
    </div>
  );
};

export default IsGoingOut;
